import * as React from "react";
import { productItem } from "./ProductItem";

export class ProductsList extends React.Component {
  productToproductItem = product => {
    //const productCategory = product.ProductCategory.PCategory;
    const productCategory = product.ProductCategory.PCategory;
    const name = product.ProductName;
    const phone = product.ProductCategory.PCategory;
    const key = product.FoodProductId;
    console.log(product.ProductName)
    return <productItem key={key} avatarUrl={productCategory} name={name} phone={phone} />;
  };

  render() {
    return (
      <ul className="ui relaxed divided list selection">
        {this.props.products.map(this.productToproductItem)}
      </ul>
    );
  }
}
